import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";
import Arr from "./Arr";
import Card from "./Card";


function App() {

  return (
    <Aux>
    {
      Arr.map( (val) => {
        return(
          <Card  head1 = {val.title}
          imgsrc = {val.src} />
        );
      }  )
    }
    </Aux>
  );
}

export default App;
